import React,{useState} from 'react';
import './App.css';
function App() {
 const values = [1,2,3,4,5,6]
 const display = (
   <ul>
     {values.map((v)=>
      <li>{v}</li>
     )}
   </ul>
 )
 const double = values.map((value)=>value*2)
 const doubles = double.map((v)=>{
   <ul>
     <li key={v.index}>{v}</li>
   </ul>
 })
 return(
   <div>
     {display}
     {doubles}
   </div>
 )
}

export default App;
